import React from 'react'
import First from './Audio/First'
import Root from './Audio/Root'
import {createBrowserRouter, RouterProvider} from 'react-router-dom'
import Second from './Audio/Second'
import Wel from './Audio/Wel'
const App = () => {
  const router=createBrowserRouter([
    {path:"/", element:<Root/>, children:[
      {path:"/", element:<First/>},
    {path:"/wel", element:<Wel/>},

    {path:"/:id", element:<Second/>}

  ]}

  ])
  return (
    <div>
      <RouterProvider router={router}/>
      <First/>

    </div>
  )
}

export default App
